import React, { Component } from 'react';

import "./Card.css";

class Card extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="card">

        <div className="card-content">
          <img />
          <p className="card-projectName">
            {this.props.projectName}
          </p>
          <p className="card-intro">
            {this.props.intro}
          </p>
          <div className="btn-container">
            <button className="main-btn">Detail</button>
            <button className="grey-btn">Download</button>
          </div>
        </div>

      </div>
    );
  }
}

export default Card;
